import React from 'react';
import axios from 'axios';


class PostsPage extends React.Component{
        constructor(props){
          super(props);
          this.state = {posts: []};
        }
        componentDidMount(){
          axios.get('https://jsonplaceholder.typicode.com/todos/1').then((result)=>this.setState({
            posts: result.data
          }))
        }
        render(){
            return
        }
    }
